import styled from "styled-components/native";

export const Button = styled.View`
  background-color: #fff;
  border: 1px solid #ccc;
  border-radius: 50px;
  padding: 6px 12px;
  width: fit-content;
  display: "flex";
  flex-direction: "row";
`;

export const ButtonAnchor = styled.Text`
  color: #747474;
`;
